"use strict";$(document).on("click",".btn-login",function(e){e.preventDefault(),$.ajax({url:login_url,type:"POST",data:$("#login_form").serialize(),success:function(e){"success"===e.status&&window.location.replace(dashboard_url)},error:function(e){$.toaster(JSON.parse(e.responseText).message,"Error","danger")}})});